const {useState} = React;

const Searchbar = () => {
 const [search, setSearch] = useState('');
    

const onChange = (e) =>{
 setSearch(e.target.value);

}

const onClick = (e) => {
 console.log('Apretando Boton');

}

return (

<div>
  <div>
    <input 
    placeholder="Buscar pokemon..." 
    onChange={onChange}
    />
  </div>
  <div>
      <button onClick={onClick}>Buscar</button>
  </div>
</div>
 
 );

};

export default Searchbar;
